import React, { Component } from 'react';

class RestauranstUpdate extends Component {
    render() {
        console.log(this.props.match.params.id)
        return (
            <div>
                Restaurants Update
                <div>
                    <input onChange={(event)=>{this.setState({name:event.target.value})}} 
                    placeholder="Restaurant Name"> </input>
                    <br></br>
                    <input onChange={(event)=>{this.setState({email:event.target.value})}} 
                    placeholder="Restaurant Email"></input>
                    <br></br>
                    <input onChange={(event)=>{this.setState({rating:event.target.value})}} 
                    placeholder="Restaurant rating"></input>
                    <br></br>
                    <input onChange={(event)=>{this.setState({adr:event.target.value})}} 
                    placeholder="Restaurant address"></input>
                    <br></br>
                    <button onClick={()=>{this.update(RestauranstUpdate)}}>Update Restaurant</button>
                </div>
            </div>
        );
    }
}

export default RestauranstUpdate;
